// Validate Delete Appointment Request - v1.0.0
const requestBody = $json.requestBody || $json;
const appointmentId = requestBody.id;

console.log('=== DELETE APPOINTMENT WITH CALENDAR v1.0.0 ===');
console.log('Appointment ID:', appointmentId);

// Validate required fields
if (!appointmentId || appointmentId.trim() === '') {
    return [{
        json: {
            success: false,
            error: 'Appointment ID is required'
        }
    }];
}

// Validate UUID format (optional but recommended)
const uuidPattern = /^[0-9a-f]{8}-[0-9a-f]{4}-4[0-9a-f]{3}-[89ab][0-9a-f]{3}-[0-9a-f]{12}$/i;
if (!uuidPattern.test(appointmentId)) {
    return [{
        json: {
            success: false,
            error: 'Invalid appointment ID format'
        }
    }];
}

console.log('✅ Delete request validated');

return [{
    json: {
        appointmentId: appointmentId,
        success: true
    }
}];

