// Validate Calendar Delete Request - v1.0.0
const appointment = $('Check Calendar Event - Code').item.json.appointment;
const driver = $input.first().json;

console.log('=== VALIDATING CALENDAR DELETE REQUEST v1.0.0 ===');
console.log('Appointment ID:', appointment.id);
console.log('Calendar Event ID:', appointment.driver_calendar_event_id);
console.log('Driver Calendar ID:', driver.google_calendar_id);

if (!appointment.id) {
    return [{
        json: {
            success: false,
            error: 'Appointment not found for calendar deletion'
        }
    }];
}

if (!appointment.driver_calendar_event_id) {
    return [{
        json: {
            success: false,
            error: 'No calendar event to delete',
            message: 'Appointment was never synced to calendar'
        }
    }];
}

if (!driver.google_calendar_id) {
    return [{
        json: {
            success: false,
            error: 'Driver calendar not configured',
            message: 'Driver does not have a calendar set up'
        }
    }];
}

console.log('✅ Calendar delete request validated');

return [{
    json: {
        success: true,
        appointmentId: appointment.id,
        eventId: appointment.driver_calendar_event_id,
        calendarId: driver.google_calendar_id,
        driverName: `${driver.first_name} ${driver.last_name}`
    }
}];

// Version: v1.0.0 - Validate calendar delete request

// Prepare Calendar Delete Result - v1.0.0
const calendarResult = $input.first().json;
const appointmentData = $('Check Calendar Event - Code').item.json;

console.log('=== PREPARING CALENDAR DELETE RESULT v1.0.0 ===');
console.log('Calendar delete result:', calendarResult);

// Check if the calendar deletion was successful
let calendarDeleteSuccess = false;
let calendarErrorMessage = null;

if (calendarResult.error || calendarResult.statusCode >= 400) {
    console.error('❌ Calendar delete failed:', calendarResult.error || calendarResult.message || 'Calendar API error');
    calendarErrorMessage = calendarResult.error || calendarResult.message || 'Calendar deletion failed';
} else {
    console.log('✅ Calendar event deleted successfully');
    calendarDeleteSuccess = true;
}

return [{
    json: {
        appointmentId: appointmentData.appointment.id,
        calendarDeleteSuccess: calendarDeleteSuccess,
        calendarErrorMessage: calendarErrorMessage,
        calendarEventId: appointmentData.calendarEventId,
        proceedWithAppointmentDelete: true // Always proceed with appointment deletion even if calendar delete fails
    }
}];

// Version: v1.0.0 - Prepare calendar delete result

// Format Delete Response - v1.0.1
const appointmentData = $('Check Calendar Event - Code').item.json;
const appointmentDeleteResult = $input.first().json;

console.log('=== FORMATTING DELETE RESPONSE v1.0.1 ===');
console.log('Appointment delete result:', appointmentDeleteResult);

// Check if appointment deletion was successful
if (appointmentDeleteResult.error) {
    return [{
        json: {
            success: false,
            message: 'Failed to delete appointment: ' + appointmentDeleteResult.error,
            appointmentId: appointmentData.appointment.id
        }
    }];
}

// Determine calendar operation status based on which path was taken
let calendarOperation = null;
if (appointmentData.needsCalendarDelete === 'true') {
    // Calendar deletion path was taken - try to get calendar result
    // Note: This node might not exist if calendar deletion failed early
    try {
        const calendarResult = $('Prepare Calendar Result - Code').first()?.json;
        if (calendarResult) {
            calendarOperation = {
                performed: true,
                success: calendarResult.calendarDeleteSuccess || false,
                eventId: appointmentData.calendarEventId,
                error: calendarResult.calendarErrorMessage || null
            };
        } else {
            // Calendar deletion path was taken but no result available (early failure)
            calendarOperation = {
                performed: true,
                success: false,
                eventId: appointmentData.calendarEventId,
                error: 'Calendar deletion failed - no result available'
            };
        }
    } catch (error) {
        // Calendar deletion path was taken but Prepare Calendar Result node didn't execute
        calendarOperation = {
            performed: true,
            success: false,
            eventId: appointmentData.calendarEventId,
            error: 'Calendar deletion failed - validation error'
        };
    }
} else {
    // No calendar deletion path was taken
    calendarOperation = {
        performed: false,
        success: true,
        message: 'No calendar event to delete'
    };
}

const calendarMessage = calendarOperation.performed ? 
    (calendarOperation.success ? 
        `Calendar event deleted successfully` : 
        `Calendar deletion failed: ${calendarOperation.error}`) : 
    'No calendar operations needed';

console.log('✅ Final delete results:', {
    appointmentDeleted: true,
    calendarOperation: calendarOperation
});

return [{
    json: {
        success: true,
        message: `Appointment deleted successfully. ${calendarMessage}`,
        appointmentId: appointmentData.appointment.id,
        deletedAt: new Date().toISOString(),
        calendarOperation: calendarOperation
    }
}];

